    ArrayList<MultiPolygon> inputs = new ArrayList<>();

    ArrayList<Geometry> expected = new ArrayList<>();

    private ArrayList<Geometry> expectedSkel = new ArrayList<>();

    @Before
    public void setUp() throws Exception {
        WKTReader2 reader = new WKTReader2();
        for (int i = 0; i < inputWKT.length; i++) {
            inputs.add((MultiPolygon) reader.read(inputWKT[i]));
            expected.add(reader.read(expectedWKT[i]));
            expectedSkel.add(reader.read(expectedSkelWKT[i]));
        }
    }

    @Test
    public void testGetCentreLine() {

        for (int i = 0; i < expected.size(); i++) {
            Geometry line = CenterLine.getCenterLine(inputs.get(i));
            assertTrue(expected.get(i).equalsNorm(line));
        }
    }

    @Test
    public void testGetSkeleton() {
        for (int i = 0; i < expected.size(); i++) {
            Geometry line = Skeletonize.getSkeleton(inputs.get(i));

            assertTrue(expectedSkel.get(i).equalsNorm(line));
        }
    }
